import './App.css';
import Header from "./components/Header/Header";
import Navbar from "./components/Navbar/Navbar";

function App() {
    return (
        <div className={"wrapper"}>
            <Header />
            <Navbar />
            <div className={"content"}>
                Main content
                <div>
                    <img src="https://images.ctfassets.net/hrltx12pl8hq/7yQR5uJhwEkRfjwMFJ7bUK/dc52a0913e8ff8b5c276177890eb0129/offset_comp_772626-opt.jpg?fit=fill&w=800&h=300" alt="Profile background image"/>
                </div>
            </div>
        </div>
    );
}

export default App;
